  return (
    <>
      <div>
        <img src="img/bear.jpg" alt="bear" />
      </div>
      <div>
        <button>이름</button>
        <button>이름</button>
        <button>이름</button>
        <button>이름</button>
        <button>이름</button>
      </div>
    </>
  );
}

const personImg = styled.img``;
